import React from 'react';
import Flashcard from '../../Components/Flashcard/Flashcard';
import CardList from '../../Components/CardList/CardList';
import flashcardData from '../../CardData/cardData.json';

const QuestionsPage = (props) => {
  var data = JSON.parse(JSON.stringify(flashcardData[topic]));
  return (
    <div>
      <div className="overlay-container">
        <h1>Flashcards Topic: { this.props.topic }</h1>
        <h2>Question Set Contains {data.flashcards.length} Flashcards</h2>
        <div>Source(s): </div>
        {this.props.sources.map((src) => (
          <div>{src}</div>
        ))}
      </div>
      <CardList flashcards={data.flashcards} />
    </div>
  );
}

export default QuestionsPage;
